import React from 'react';
import { connect } from 'react-redux';
import { withStyles } from '@material-ui/styles';
import { getPresencesDetail } from './../../actions/presencesDetail';
import { LoadingCenter } from 'components';
import { PresencesDetailToolbar, PresencesTable } from './components';
import styles from './styles';

const PresencesDetail = props => {
    const { classes, isLoading, presenceDetailClass, getPresencesDetail } = props;

    if(isLoading) return <LoadingCenter />
    return (
        <div className={classes.root}>
            <PresencesDetailToolbar />
            <div className={classes.content}>
                <PresencesTable />
            </div>
        </div>
    );
};
const mapStateToProps = state => ({
    presenceDetailClass: state.presenceDetailClass,
    isLoading: state.isLoading.isLoading,
});
export default connect(mapStateToProps, { getPresencesDetail })(withStyles(styles)(PresencesDetail));
